        t ^= TE3[(tmp >>> 8) & 0xff] & 0x00ff0000;
        t ^= TE0[(tmp >>> 0) & 0xff] & 0x0000ff00;
        t ^= TE1[(tmp >>> 24) & 0xff] & 0x000000ff;
